import React from 'react';

const Logo = ({ size = 'lg' }) => {
  const sizes = {
    sm: { container: '30px', icon: '20px', text: '16px' },
    md: { container: '40px', icon: '25px', text: '20px' },
    lg: { container: '50px', icon: '30px', text: '24px' }
  };

  return (
    <div className="logo">
      <div 
        className="logo-icon"
        style={{
          width: sizes[size].container,
          height: sizes[size].container,
          fontSize: sizes[size].icon
        }}
      >
        A
      </div>
      <span style={{ fontSize: sizes[size].text }}>AgentFlow</span>
    </div>
  );
};

export default Logo;
